import { 
    Flex, Stack, Grid, Box, Text
 } from "@chakra-ui/core";
import { Form } from "../../components/Form";


const Home = () => {
    return (
        <Flex
            backgroundColor="green"
            w="100vw"
            h="100vh"
            align="center"
            justify="center"
        >
            <Flex align="center">
            <Flex bg="green.50" align="flex-end">
                <Text>Box 1</Text>
            </Flex>
            <Flex bg="blue.50" size="150px" align="center" justify="center">
                <Text textAlign="center" bg="pink.50">
                Box 2
                </Text>
            </Flex>
            <Box>
                <Text bg="tomato" color="white">
                Box 3
                </Text>
            </Box>
            </Flex>
        </Flex>
    );
}

export default Home;
